sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.payload = {};
  outputs.payload.name = inputs.name;
  outputs.payload.description = inputs.description;
  if (inputs.autojoin) {
    outputs.payload.autojoin = inputs.autojoin;
  }
  if (inputs.adminPrivileges) {
    outputs.payload.adminPrivileges = inputs.adminPrivileges;
  }
  outputs.payload.realm = inputs.realm;
  outputs.payload.realmAttributes = inputs.realmAttributes;
  outputs.payload.userNames = [];
  outputs.payload.userNames = inputs.userNames;
  if (inputs.watchManager) {
    outputs.payload.watchManager = inputs.watchManager;
  }
  if (inputs.policyManager) {
    outputs.payload.policyManager = inputs.policyManager;
  }
  if (inputs.reportsManager) {
    outputs.payload.reportsManager = inputs.reportsManager;
  }
  outputs.payload.externalid = inputs.externalid;
})(inputs, outputs);

